import React from "react";

export default function ProfileScreen(props) {
  // fetch(ENV.API + )
  console.log(props.user);
  console.log(props.dog);
  if (!props.user) {
    return "oops";
  }
  return (
    <div>
      <h1>Welcome {props.user.firstName}</h1>
    </div>
  );
}
